import { Button } from '../navbar/Button'
// import { FinishMonth } from './FinishMonth'
import { FinishYear } from './FinishYear'

function StepFour() {
    return (
        <div className="four">
            <div className="step-four">
                <header>
                    <h3>Finishing up</h3>
                    <span className="header-span">
                        Double-check everything looks OK before confirming.
                    </span>
                </header>
                {/* <FinishMonth /> */}
                <FinishYear />
            </div>
            <Button />
        </div>
    )
}

export { StepFour }
